,'s:17:\"use the write API\";'),('en','messages:actioncomplete','s:15:\"Action complete\";'),('en','messages:actionfailed','s:13:\"Action failed\";'),('en','messages:actions','s:7:\"Actions\";'),('en','messages:actionthrottled','s:16:\"Action throttled\";'),('en','messages:actionthrottledtext','s:179:\"As an anti-abuse measure, you are limited from performing this action too many times in a short space of time, and you have exceeded this limit.\nPlease try again in a few minutes.\";'),('en','messages:activeusers','s:17:\"Active users list\";'),('en','messages:activeusers-count','s:69:\"$1 {{PLURAL:$1|action|actions}} in the last {{PLURAL:$3|day|$3 days}}\";'),('en','messages:activeusers-excludegroups','s:34:\"Exclude users belonging to groups:\";'),('en','messages:activeusers-from','s:26:\"Display users starting at:\";'),('en','messages:activeusers-groups','s:34:\"Display users belonging to groups:\";'),('en','messages:activeusers-intro','s:96:\"This is a list of users who had some kind of activity within the last $1 {{PLURAL:$1|day|days}}.\";'),('en','messages:activeusers-noresult','s:15:\"No users found.\";'),('en','messages:activeusers-submit','s:20:\"Display active users\";'),('en','messages:activeusers-summary','s:0:\"\";'),('en','messages:addedwatchexpiry-options-label','s:22:\"Watchlist time period:\";'),('en','messages:addedwatchexpiryhours','s:106:\"\"[[:$1]]\" and its discussion page have been added to your [[Special:Watchlist|watchlist]] for a few hours.\";'),('en','messages:addedwatchexpiryhours-talk','s:106:\"\"[[:$1]]\" and its associated page have been added to your [[Special:Watchlist|watchlist]] for a few hours.\";'),('en','messages:addedwatchexpirytext','s:97:\"\"[[:$1]]\" and its discussion page have been added to your [[Special:Watchlist|watchlist]] for $2.\";'),('en','messages:addedwatchexpirytext-talk','s:97:\"\"[[:$1]]\" and its associated page have been added to your [[Special:Watchlist|watchlist]] for $2.\";'),('en','messages:addedwatchindef