rol-example-revid','s:18:\"Patrol a revision.\";'),('en','messages:apihelp-patrol-param-rcid','s:27:\"Recentchanges ID to patrol.\";'),('en','messages:apihelp-patrol-param-revid','s:22:\"Revision ID to patrol.\";'),('en','messages:apihelp-patrol-param-tags','s:52:\"Change tags to apply to the entry in the patrol log.\";'),('en','messages:apihelp-patrol-summary','s:26:\"Patrol a page or revision.\";'),('en','messages:apihelp-php-param-formatversion','s:17:\"Output formatting\";'),('en','messages:apihelp-php-paramvalue-formatversion-1','s:94:\"Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\";'),('en','messages:apihelp-php-paramvalue-formatversion-2','s:14:\"Modern format.\";'),('en','messages:apihelp-php-paramvalue-formatversion-latest','s:75:\"Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-php-summary','s:37:\"Output data in serialized PHP format.\";'),('en','messages:apihelp-phpfm-summary','s:60:\"Output data in serialized PHP format (pretty-print in HTML).\";'),('en','messages:apihelp-protect-example-protect','s:15:\"Protect a page.\";'),('en','messages:apihelp-protect-example-unprotect','s:105:\"Unprotect a page by setting restrictions to <kbd>all</kbd> (i.e. everyone is allowed to take the action).\";'),('en','messages:apihelp-protect-example-unprotect2','s:44:\"Unprotect a page by setting no restrictions.\";'),('en','messages:apihelp-protect-param-cascade','s:160:\"Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),('en','messages:apihelp-protect-param-expiry','s:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),('en','messages:apihelp-protect-param-pageid','s:68:\"ID of the page to (un)protect. Cannot be used together with $1title.\";'),('en','messages:apihelp-protect-param-protections','s:262:\"List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>). A level of <kbd>all</kbd> means everyone is allowed to take the action, i.e. no restriction.\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),('en','messages:apihelp-protect-param-reason','s:26:\"Reason for (un)protecting.\";'),('en','messages:apihelp-protect-param-tags','s:56:\"Change tags to apply to the entry in the protection log.\";'),('en','messages:apihelp-protect-param-title','s:72:\"Title of the page to (un)protect. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-protect-param-watch','s:73:\"If set, add the page being (un)protected to the current user\'s watchlist.\";'),('en','messages:apihelp-protect-param-watchlist','s:137:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-protect-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-protect-summary','s:38:\"Change the protection level of a page.\";'),('en','messages:apihelp-purge-example-generator','s:47:\"Purge the first 10 pages in the main namespace.\";'),('en','messages:apihelp-purge-example-simple','s:59:\"Purge the <kbd>Main Page</kbd> and the <kbd>API</kbd> page.\";'),('en','messages:apihelp-purge-param-forcelinkupdate','s:60:\"Update the links tables and do other secondary data updates.\";'),('en','messages:apihelp-purge-param-forcerecursivelinkupdate','s:111:\"Same as <kbd>forcelinkupdate</kbd>, and update the links tables for any page that uses this page as a template.\";'),('en','messages:apihelp-purge-summary','s:37:\"Purge the cache for the given titles.\";'),('en','messages:apihelp-query+allcategories-example-generator','s:86:\"Retrieve info about the category page itself for categories beginning <kbd>List</kbd>.\";'),('en','messages:apihelp-query+allcategories-example-size','s:64:\"List categories with information on the number of pages in each.\";'),('en','messages:apihelp-query+allcategories-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allcategories-param-from','s:39:\"The category to start enumerating from.\";'),('en','messages:apihelp-query+allcategories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+allcategories-param-max','s:54:\"Only return categories with at most this many members.\";'),('en','messages:apihelp-query+allcategories-param-min','s:55:\"Only return categories with at least this many members.\";'),('en','messages:apihelp-query+allcategories-param-prefix','s:58:\"Search for all category titles that begin with this value.\";'),('en','messages:apihelp-query+allcategories-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+allcategories-param-to','s:36:\"The category to stop enumerating at.\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-size','s:37:\"Adds number of pages in the category.\";'),('en','messages:apihelp-query+allcategories-summary','s:25:\"Enumerate all categories.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-ns-main','s:58:\"List the first 50 deleted revisions in the main namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-user','s:66:\"List the last 50 deleted contributions by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('e