summary','s:34:\"Enumerate all images sequentially.\";'),('en','messages:apihelp-query+alllinks-example-b','s:98:\"List linked titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alllinks-example-generator','s:32:\"Gets pages containing the links.\";'),('en','messages:apihelp-query+alllinks-example-unique','s:26:\"List unique linked titles.\";'),('en','messages:apihelp-query+alllinks-example-unique-generator','s:49:\"Gets all linked titles, marking the missing ones.\";'),('en','messages:apihelp-query+alllinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+alllinks-param-from','s:48:\"The title of the link to start enumerating from.\";'),('en','messages:apihelp-query+alllinks-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+alllinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+alllinks-param-prefix','s:56:\"Search for all linked titles that begin with this value.\";'),('en','messages:apihelp-query+alllinks-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+alllinks-param-to','s:45:\"The title of the link to stop enumerating at.\";'),('en','messages:apihelp-query+alllinks-param-unique','s:147:\"Only show distinct linked titles. Cannot be used with <kbd>$1prop=ids</kbd>.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alllinks-paramvalue-prop-ids','s:79:\"Adds the page ID of the linking page (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+alllinks-paramvalue-prop-title','s:27:\"Adds the title of the link.\";'),('en','messages:apihelp-query+alllinks-summary','s:52:\"Enumerate all links that point to a given namespace.\";'),('en','messages:apihelp-query+allmessages-example-de','s:66:\"Show messages <kbd>august</kbd> and <kbd>mainpage</kbd> in German.\";