,'s:31:\"Return messages from this site.\";'),('en','messages:apihelp-query+allpages-example-b','s:57:\"Show a list of pages starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator','s:60:\"Show info about 4 pages starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator-revisions','s:70:\"Show content of first 2 non-redirect pages beginning at <kbd>Re</kbd>.\";'),('en','messages:apihelp-query+allpages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allpages-param-filterlanglinks','s:108:\"Filter based on whether a page has langlinks. Note that this may not consider langlinks added by extensions.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:20:\"Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-from','s:41:\"The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+allpages-param-maxsize','s:44:\"Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+allpages-param-minsize','s:45:\"Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+allpages-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allpages-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+allpages-param-prexpiry','s:223:\"Which protection expiry to filter the page on:\n;indefinite:Get only pages with indefinite protection expiry.\n;definite:Get only pages with a definite (specific) protection expiry.\n;all:Get pages with any protections expiry.\";'),('en','messages:apihelp-query+allpages-param-prfiltercascade','s:76:\"Filter protections based on cascadingness (ignored when $1prtype isn\'t set).\";'),('en','messages:apihelp-query+allpages-param-prlevel','s:85:\"Filter protections based on protection level (must be used with $1prtype= parameter).\";'),('en','messages:apihelp-query+allpages-param-prtype','s:30:\"Limit to protected pages only.\";'),('en','messages:apihelp-query+allpages-param-to','s:38:\"The page title to stop enumerating at.\";'),('en','messages:apihelp-query+allpages-summary','s:54:\"Enumerate all pages sequentially in a given namespace.\";'),('en','messages:apihelp-query+allredirects-example-b','s:97:\"List target pages, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allredirects-example-generator','s:36:\"Gets pages containing the redirects.\";'),('en','messages:apihelp-query+allredirects-example-unique','s:25:\"List unique target pages.\";'),('en','messages:apihelp-query+allredirects-example-unique-generator','s:48:\"Gets all target pages, marking the missing ones.\";'),('en','messages:apihelp-query+allredirects-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allredirects-param-from','s:52:\"The title of the redirect to start enumerating from.\";'),('en','messages:apihelp-query+allredirects-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+allredirects-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allredirects-param-prefix','s:55:\"Search for all target pages that begin with this value.\";'),('en','messages:apihelp-query+allredirects-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+allredirects-param-to','s:49:\"The title of the redirect to stop enumerating at.\";'),('en','messages:apihelp-query+allredirects-param-unique','s:154:\"Only show distinct target pages. Cannot be used with $1prop=ids|fragment|interwiki.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-fragment','s:86:\"Adds the fragment from the redirect, if any (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-ids','s:83:\"Adds the page ID of the redirecting page (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-interwiki','s:94:\"Adds the interwiki prefix from the redirect, if any (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-paramvalue-prop-title','s:31:\"Adds the title of the redirect.\";'),('en','messages:apihelp-query+allredirects-summary','s:34:\"List all redirects to a namespace.\";'),('en','messages:apihelp-query+allrevisions-example-ns-any','s:45:\"List the first 50 revisions in any namespace.\";'),('en','messages:apihelp-query+allrevisions-example-user','s:58:\"List the last 50 contributions by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+allrevisions-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+allrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+allrevisions-param-generatetitles','s:73:\"When being used as a generator, generate titles rather than revision IDs.\";'),('en','messages:apihelp-query+allrevisions-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+allrevisions-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+allrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+allrevisions-summary','s:19:\"List all revisions.\";'),('en','messages:apihelp-query+alltransclusions-example-b','s:103:\"List transcluded titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alltransclusions-example-generator','s:40:\"Gets pages containing the transclusions.\";'),('en','messages:apihelp-query+alltransclusions-example-unique','s:31:\"List