her the user is attached with the wiki identified by this ID.\";'),('en','messages:apihelp-query+allusers-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allusers-param-excludegroup','s:34:\"Exclude users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-from','s:40:\"The user name to start enumerating from.\";'),('en','messages:apihelp-query+allusers-param-group','s:39:\"Only include users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-limit','s:36:\"How many total user names to return.\";'),('en','messages:apihelp-query+allusers-param-prefix','s:48:\"Search for all users that begin with this value.\";'),('en','messages:apihelp-query+allusers-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+allusers-param-rights','s:141:\"Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-to','s:37:\"The user name to stop enumerating at.\";'),('en','messages:apihelp-query+allusers-param-witheditsonly','s:36:\"Only list users who have made edits.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:55:\"Adds the information about a current block on the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-centralids','s:56:\"Adds the central IDs and attachment status for the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:32:\"Adds the edit count of the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-groups','s:110:\"Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:50:\"Lists all the groups the user is automatically in.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-registration','s:75:\"Adds the timestamp of when the user registered if available (may be blank).\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-rights','s:31:\"Lists rights that the user has.\";'),('en','messages:apihelp-query+allusers-summary','s:31:\"Enumerate all registered users.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login','s:59:\"Fetch the requests that may be used when beginning a login.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login-merged','s:84:\"Fetch the requests that may be used when beginning a login, with form fields merged.\";'),('en','messages:apihelp-query+authmanagerinfo-example-securitysensitiveoperation','s:68:\"Test whether authentication is sufficient for action <kbd>foo</kbd>.\";'),('en','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:99:\"Fetch information about the authentication requests needed for the specified authentication action.\";'),('en','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:115:\"Test whether the user\'s current authentication status is sufficient for the specified security-sensitive operation.\";'),('en','messages:apihelp-query+authmanagerinfo-summary','s:61:\"Retrieve information about the current authentication status.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:60:\"Get information about pages linking to <kbd>Main page</kbd>.\";'),('en','messages:apihelp-query+backlinks-example-simple','s:35:\"Show links to <kbd>Main page</kbd>.\";'),('en','messages:apihelp-query+backlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:143:\"How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:67:\"Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-param-title','s:66:\"Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-summary','s:43:\"Find all pages that link to the given page.\";'),('en','messages:apihelp-query+blocks-example-simple','s:12:\"List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:57:\"List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+blocks-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:37:\"List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:192:\"Get all blocks applying to this IP address or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:37:\"The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+blocks-param-show','s:133:\"Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-users','s:39:\"List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-by','s:39:\"Adds the username of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-byid','s:38:\"Adds the user ID of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:45:\"Adds the timestamp of when the block expires.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-flags','s:46:\"Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-id','s:25:\"Adds the ID of the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-range','s:53:\"Adds the range of IP addresses affected by the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-reason','s:36:\"Adds the reason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-restrictions','s:65:\"Adds the partial block restrictions if the block is not sitewide.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:47:\"Adds the timestamp of when the block was given.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-user','s:38:\"Adds the username of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-userid','s:37:\"Adds the user ID of the blocked user.\";'),('en','messages:apihelp-query+blocks-summary','s:40:\"List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+categories-example-generator','s:81:\"Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categories-example-simple','s:72:\"Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-param-categories','s:96:\"Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+categories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+categories-param-prop','s:53:\"Which additional properties to get for each category:\";'),('en','messages:apihelp-query+categories-param-show','s:33:\"Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:96:\"Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:46:\"Adds timestamp of when the category was added.\";'),('en','messages:apihelp-query+categories-summary','s:40:\"List all categories the pages belong to.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:74:\"Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-summary','s:47:\"Returns information about the given categories.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:66:\"Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:50:\"Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:79:\"Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:117:\"Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:28:\"Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:192:\"Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:166:\"Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:86:\"Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:20:\"Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:83:\"Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:121:\"Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:30:\"Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:126:\"Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:142:\"Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:91:\"Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:71:\"Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:94:\"Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:49:\"Adds the timestamp of when the page was included.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:114:\"Adds the type that the page has been categorised as (<samp>page</samp>, <samp>subcat</samp> or <samp>file</samp>).\";'),('en','messages:apihelp-query+categorymembers-summary','s:35:\"List all pages in a given category.\";'),('en','messages:apihelp-query+contributors-example-simple','s:51:\"Show contributors to the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+contributors-param-excludegroup','s:116:\"Exclude users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excluderights','s:138:\"Exclude users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-group','s:121:\"Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-limit','s:32:\"How many contributors to return.\";'),('en','messages:apihelp-query+contributors-param-rights','s:143:\"Only include users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-summary','s:89:\"Get the list of logged-in contributors and the count of anonymous contributors to a page.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:60:\"List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:105:\"List the deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content.\";'),('en','messages:apihelp-query+deletedrevisions-extended-description','s:236:\"May be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:85:\"The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:88:\"The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-summary','s:33:\"Get deleted revision information.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-extended-description','s:378:\"Operates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-summary','s:23:\"List deleted revisions.\";'),('en','messages:apihelp-query+disabled-summary','s:36:\"This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:35:\"How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-summary','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+embeddedin-example-generator','s:66:\"Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-example-simple','s:49:\"Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+embeddedin-param-filterredir','s:28:\"How to filter for redirects.\";'),('en','messages:apihelp-query+embeddedin-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+embeddedin-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+embeddedin-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+embeddedin-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+embeddedin-summary','s:55:\"Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+extlinks-example-simple','s:53:\"Get a list of external links on <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+extlinks-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+extlinks-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+extlinks-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+extlinks-param-query','s:107:\"Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('en','messages:apihelp-query+extlinks-summary','s:64:\"Returns all external URLs (not interwikis) from the given pages.\";'),('en','messages:apihelp-query+exturlusage-example-simple','s:59:\"Show pages linking to <kbd>https://www.mediawiki.org</kbd>.\";'),('en','messages:apihelp-query+exturlusage-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+exturlusage-param-limit','s:25:\"How many pages to return.\";'),('en','messages:apihelp-query+exturlusage-param-namespace','s:33:\"The page namespaces to enumerate.\";'),('en','messages:apihelp-query+exturlusage-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+exturlusage-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-query','s:99:\"Search string without protocol. See [[Special:LinkSearch]]. Leave empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:20:\"Adds the ID of page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:30:\"Adds the URL used in the page.\";'),('en','messages:apihelp-query+exturlusage-summary','s:41:\"Enumerate pages that contain a given URL.\";'),('en','messages:apihelp-query+filearchive-example-simple','s:33:\"Show a list of all deleted files.\";'),('en','messages:apihelp-query+filearchive-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-from','s:42:\"The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:35:\"How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:55:\"Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-prop','s:31:\"Which image information to get:\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-to','s:39:\"The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-description','s:38:\"Adds description of the image version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mediatype','s:33:\"Adds the media type of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-metadata','s:49:\"Lists Exif metadata for the version of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mime','s:23:\"Adds MIME of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-parseddescription','s:37:\"Parse the description of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:30:\"Adds SHA-1 hash for the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-size','s:89:\"Adds the size of the image in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-user','s:41:\"Adds user who uploaded the image version.\";'),('en','messages:apihelp-query+filearchive-summary','s:41:\"Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filerepoinfo-example-simple','s:40:\"Get information about file repositories.\";'),('en','messages:apihelp-query+filerepoinfo-param-prop','s:82:\"Which repository properties to get (properties available may vary on other wikis).\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-apiurl','s:73:\"URL to the repository API - helpful for getting image info from the host.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath','s:106:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-canUpload','s:90:\"Whether files can be uploaded to this repository, e.g. via CORS and shared authentication.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:47:\"The human-readable name of the repository wiki.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:102:\"Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:106:\"Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:58:\"Whether file names implicitly start with a capital letter.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:48:\"Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:189:\"The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:30:\"Root URL path for image paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:63:\"Root URL path for the repository wiki\'s MediaWiki installation.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:96:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:34:\"Root URL path for thumbnail paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:21:\"Public zone URL path.\";'),('en','messages:apihelp-query+filerepoinfo-summary','s:72:\"Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+fileusage-example-generator','s:56:\"Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-simple','s:48:\"Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+fileusage-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-title','s:19:\"Title of each page.\";'),('en','messages:apihelp-query+fileusage-summary','s:40:\"Find all pages that use the given files.\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:75:\"Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:82:\"Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-param-badfilecontexttitle','s:113:\"If <kbd>$2prop=badfile</kbd> is set, this is the page title used when evaluating the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-param-end','s:29:\"Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:84:\"If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:180:\"What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:74:\"If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:43:\"How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:136:\"Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:30:\"Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-param-start','s:32:\"Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:22:\"Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:170:\"A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:174:\"If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:157:\"Adds the filename of the archive version for non-latest versions. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:60:\"Adds whether the file is on the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:126:\"Adds the bit depth of the version. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:129:\"Adds the canonical title of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:121:\"Comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:155:\"Lists file format generic metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:176:\"Lists formatted metadata combined from multiple sources. Results are HTML formatted. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:124:\"Adds the media type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:140:\"Lists Exif metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:119:\"Adds MIME type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:131:\"Parse the comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:121:\"Adds SHA-1 hash for the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:88:\"Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:166:\"Adds MIME type of the image thumbnail (requires url and param $1urlwidth). If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:119:\"Used by the Special:Upload page to get information about an existing file. Not intended for use outside MediaWiki core.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:139:\"Gives URL to the file and the description page. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:137:\"Adds the user who uploaded each file version. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:147:\"Add the ID of the user that uploaded each file version. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-summary','s:44:\"Returns file information and upload history.\";'),('en','messages:apihelp-query+images-example-generator','s:58:\"Get information about all files used in the [[Main Page]].\";'),('en','messages:apihelp-query+images-example-simple','s:46:\"Get a list of files used in the [[Main Page]].\";'),('en','messages:apihelp-query+images-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+images-param-images','s:85:\"Only list these files. Useful for checking whether a certain page has a certain file.\";'),('en','messages:apihelp-query+images-param-limit','s:25:\"How many files to return.\";'),('en','messages:apihelp-query+images-summary','s:47:\"Returns all files contained on the given pages.\";'),('en','messages:apihelp-query+imageusage-example-generator','s:69:\"Get information about pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-example-simple','s:52:\"Show pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+imageusage-param-filterredir','s:121:\"How to filter for redirects. If set to nonredirects when $1redirect is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+imageusage-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+imageusage-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+imageusage-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+imageusage-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+imageusage-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+imageusage-summary','s:46:\"Find all pages that use the given image title.\";'),('en','messages:apihelp-query+info-example-protection','s:75:\"Get general and protection information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-example-simple','s:52:\"Get information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-param-linkcontext','s:134:\"The context title to use when determining extra CSS classes (e.g. link colors) when <var>$1prop</var> contains <var>linkclasses</var>.\";'),('en','messages:apihelp-query+info-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+info-param-testactions','s:70:\"Test whether the current user can perform certain actions on the page.\";'),('en','messages:apihelp-query+info-param-testactionsdetail','s:196:\"Detail level for <var>$1testactions</var>. Use the [[Special:ApiHelp/main|main module]]\'s <var>errorformat</var> and <var>errorlang</var> parameters to control the format of the messages returned.\";'),('en','messages:apihelp-query+info-paramvalue-prop-associatedpage','s:107:\"The prefixed title of the [[:mw:Special:MyLanguage/Help:Associated_pages|associated subject or talk page]].\";'),('en','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:63:\"Gives the manner in which the page title is actually displayed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-linkclasses','s:149:\"Gives the additional CSS classes (e.g. link colors) used for links to this page if they were to appear on the page named by <var>$1linkcontext</var>.\";'),('en','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:50:\"The watchlist notification timestamp of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preload','s:47:\"Gives the text returned by EditFormPreloadText.\";'),('en','messages:apihelp-query+info-paramvalue-prop-protection','s:39:\"List the protection level of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-readable','s:79:\"Whether the user can read this page. Use <kbd>intestactions=read</kbd> instead.\";'),('en','messages:apihelp-query+info-paramvalue-prop-subjectid','s:50:\"The page ID of the parent page for each talk page.\";'),('en','messages:apihelp-query+info-paramvalue-pro