aram-prefix','s:25:\"Prefix for the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+iwbacklinks-param-title','s:70:\"Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:33:\"Adds the prefix of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:32:\"Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-summary','s:53:\"Find all pages that link to the given interwiki link.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:35:\"How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:45:\"Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:59:\"Which additional properties to get for each interwiki link:\";'),('en','messages:apihelp-query+iwlinks-param-title','s:68:\"Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:57:\"Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-summary','s:49:\"Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:52:\"Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:34:\"Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-extended-description','s:230:\"Can be used to find all links with a language code, or