lp-query+revisions+base-paramvalue-prop-slotsize','s:37:\"Length (bytes) of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:22:\"Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:30:\"The timestamp of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:120:\"User that made the revision. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:124:\"User ID of the revision creator. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions-example-content','s:94:\"Get data with content for the last revision of titles <kbd>API</kbd> and <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5','s:50:\"Get first 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-after','s:72:\"Get first 5 revisions of the <kbd>Main Page</kbd> made after 2006-05-01.\";'),('en','messages:apihelp-query+revisions-example-first5-not-localhost','s:108:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-user','s:106:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were made by the user <kbd>MediaWiki default</kbd>.\";'),('en','messages:apihelp-query+revisions-example-last5','s:49:\"Get last 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-extended-description','s:267:\"May be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";