ilable.\";'),('en','messages:apihelp-query+search-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+search-param-namespace','s:36:\"Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-prop','s:27:\"Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:61:\"Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-param-search','s:175:\"Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-sort','s:39:\"Set the sort order of returned results.\";'),('en','messages:apihelp-query+search-param-what','s:32:\"Which type of search to perform.\";'),('en','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:47:\"Adds a parsed snippet of the matching category.\";'),('en','messages:apihelp-query+search-paramvalue-prop-extensiondata','s:40:\"Adds extra data generated by extensions.\";'),('en','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:8:\"Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:61:\"Adds a boolean indicating if the search matched file content.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:44:\"Adds a parsed snippet of the redirect title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:40:\"Adds the title of the matching redirect.\";'),('en','messages:apihelp-query+search-paramvalue-prop-score','s:8:\"Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:52:\"Adds a parsed snippet of the matching section title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:39:\"Adds the title of the matching section.\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:35:\"Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:34:\"Adds a parsed snippet of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:52:\"Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:40:\"Adds a parsed snippet of the page title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-wordcount','s:32:\"Adds the word count of the page.\";'),('en','messages:apihelp-query+search-summary','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+siteinfo-example-interwiki','s:41:\"Fetch a list of local interwiki prefixes.\";'),('en','messages:apihelp-query+siteinfo-example-replag','s:34:\"Check the current replication lag.\";'),('en','messages:apihelp-query+siteinfo-example-simple','s:23:\"Fetch site information.\";'),('en','messages:apihelp-query+siteinfo-param-filteriw','s:64:\"Return only local or only nonlocal entries of the interwiki map.\";'),('en','messages:apihelp-query+siteinfo-param-inlanguagecode','s:72:\"Language code for localised language names (best effort) and skin names.\";'),('en','messages:apihelp-query+siteinfo-param-numberingroup','s:41:\"Lists the number of users in user groups.\";'),('en','messages:apihelp-query+siteinfo-param-prop','s:25:\"Which information to get:\";'),('en','messages:apihelp-query+siteinfo-param-showalldb','s:61:\"List all database servers, not just the one lagging the most.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-dbrepllag','s:57:\"Returns database server with the highest replication lag.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-defaultoptions','s:48:\"Returns the default values for user preferences.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensions','s:41:\"Returns extensions installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensiontags','s:40:\"Retu