 password reset routes are available.\n\nEnable routes in <var>[[mw:Special:MyLanguage/Manual:$wgPasswordResetRoutes|$wgPasswordResetRoutes]]</var> to use this module.\";'),('en','messages:apihelp-resetpassword-param-email','s:38:\"Email address of the user being reset.\";'),('en','messages:apihelp-resetpassword-param-user','s:17:\"User being reset.\";'),('en','messages:apihelp-resetpassword-summary','s:38:\"Send a password reset email to a user.\";'),('en','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('en','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('en','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-tags','s:47:\"Tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-summary','s:30:\"Delete and undelete revisions.\";'),('en','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-extended-description','s:96:\"If the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-tags','s:30:\"Tags to apply to the rollback.\";'),('en','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-watchlist','s:137:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-rollback-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-rollback-summary','s:31:\"Undo the last edit to the page.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-rsd-summary','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-extended-description','s:168:\"This affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:26:\"Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-summary','s:52:\"Update the notification timestamp for watched pages.\";'),('en','messages:apihelp-setpagelanguage-example-default','s:83:\"Change the language of the page with ID 123 to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-example-language','s:54:\"Change the language of <kbd>Main Page</kbd> to Basque.\";'),('en','messages:apihelp-setpagelanguage-extended-description-disabled','s:174:\"Changing the language of a page is not allowed on this wiki.\n\nEnable <var>[[mw:Special:MyLanguage/Manual:$wgPageLanguageUseDB|$wgPageLanguageUseDB]]</var> to use this action.\";'),('en','messages:apihelp-setpagelanguage-param-lang','s:133:\"Language code of the language to change the page to. Use <kbd>default</kbd> to reset the page to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-param-pageid','s:103:\"Page ID of the page whose language you wish to change. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-setpagelanguage-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-setpagelanguage-param-tags','s:65:\"Change tags to apply to the log entry resulting from this action.\";'),('en','messages:apihelp-setpagelanguage-param-title','s:102:\"Title of the page whose language you wish to change. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-setpagelanguage-summary','s:30:\"Change the language of a page.\";'),('en','messages:apihelp-stashedit-extended-description','s:100:\"This is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-stashedit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-stashedit-param-stashedtexthash','s:52:\"Page content hash from a prior stash to use instead.\";'),('en','messages:apihelp-stashedit-param-summary','s:15:\"Change summary.\";'),('en','messages:apihelp-stashedit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-stashedit-param-title','s:31:\"Title of the page being edited.\";'),('en','messages:apihelp-stashedit-summary','s:32:\"Prepare an edit in shared cache.\";'),('en','messages:apihelp-summary','s:0:\"\";'),('en','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tag-example-rev','s:79:\"Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-tags','s:79:\"Tags to apply to the log entry that will be created as a result of this action.\";'),('en','messages:apihelp-tag-summary','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-unblock-example-id','s:33:\"Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-unblock-param-id','s:117:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:19:\"Reason for unblock.\";'),('en','messages:apihelp-unblock-param-tags','s:51:\"Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-unblock-param-user','s:62:\"User to unblock. Cannot be used together with <var>$1id</var>.\";'),('en','messages:apihelp-unblock-param-userid','s:49:\"Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-unblock-summary','s:15:\"Unblock a user.\";'),('en','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-extended-description','s:253:\"A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-reason','s:21:\"Reason for restoring.\";'),('en','messages:apihelp-undelete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('en','messages:apihelp-undelete-param-watchlist','s:137:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-undelete-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-undelete-summary','s:36:\"Restore revisions of a deleted page.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:111:\"Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-unlinkaccount-summary','s:58:\"Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-extended-description','s:547:\"Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:137:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-upload-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-upload-summary','s:52:\"Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:72:\"Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:115:\"Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:360:\"Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:57:\"Change tags to apply to the entry in the user rights log.\";'),('en','messages:apihelp-userrights-param-user','s:5:\"User.\";'),('en','messages:apihelp-userrights-param-userid','s:49:\"Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-userrights-summary','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-validatepassword-example-1','s:61:\"Validate the password <kbd>foobar</kbd> for the current user.\";'),('en','messages:apihelp-validatepassword-example-2','s:77:\"Validate the password <kbd>qwerty</kbd> for creating user <kbd>Example</kbd>.\";'),('en','messages:apihelp-validatepassword-extended-description','s:206:\"Validity is reported as <samp>Good</samp> if the password is acceptable, <samp>Change</samp> if the password may be used for login but must be changed, or <samp>Invalid</samp> if the password is not usable.\";'),('en','messages:apihelp-validatepassword-param-email','s:53:\"Email address, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-password','s:21:\"Password to validate.\";'),('en','messages:apihelp-validatepassword-param-realname','s:49:\"Real name, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-user','s:80:\"User name, for use when testing account creation. The named user must not exist.\";'),('en','messages:apihelp-validatepassword-summary','s:57:\"Validate a password against the wiki\'s password policies.\";'),('en','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('en','messages:apihelp-watch-example-unwatch','s:38:\"Unwatch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-watch','s:36:\"Watch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-watch-expiry','s:87:\"