lication.\n\nSpcifiez le paramtre <var>format</var> pour modifier le format de sortie. Pour voir la reprsentation non HTML du format $1, mettez <kbd>format=$2</kbd>.\n\nVoyez la [[mw:Special:MyLanguage/API|documentation complte]], ou l[[Special:ApiHelp/main|aide de lAPI]] pour plus dinformation.\";'),('fr','messages:api-format-prettyprint-header-hyperlinked','s:421:\"Voici la reprsentation HTML du format $1. HTML convient au dbogage, mais est inappropri pour tre utilis dans une application.\n\nSpcifiez le paramtre <var>format</var> pour modifier le format de sortie. Pour voir la reprsentation non HTML du format $1, mettez [$3 <kbd>format=$2</kbd>].\n\nVoir la [[mw:API|documentation complte]], ou l[[Special:ApiHelp/main|aide de lAPI]] pour plus dinformations.\";'),('fr','messages:api-format-prettyprint-header-only-html','s:258:\"Ceci est une reprsentation HTML  des fins de dbogage, et nest pas appropri pour une utilisation applicative.\n\nVoir la [[mw:Special:MyLanguage/API|documentation complte]], ou l[[Special:ApiHelp/main|aide de lAPI]] pour plus dinformation.\";'),('fr','messages:api-format-prettyprint-status','s:59:\"Cette rponse serait retourne avec ltat HTTP $1 $2.\";'),('fr','messages:api-format-title','s:33:\"Rsultat de lAPI de MediaWiki\";'),('fr','messages:api-help-authmanager-general-usage','s:1441:\"La procdure gnrale pour utiliser ce module est la suivante:\n# Rcuprer les champs disponibles avec <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$4</kbd>, et un jeton <kbd>$5</kbd> avec <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Prsenter les champs  lutilisateur, et les lui faire soumettre.\n# Faire un envoi  ce module, en fournissant <var>$1returnurl</var> et les champs appropris.\n# Vrifier le <samp>status</samp> dans la rponse.\n#* Si vous avez reu <samp>PASS</samp> ou <samp>FAIL</samp>, cest termin. Lopration a soit russi, soit chou.\n#* Si vous avez reu <samp>UI</samp>, affichez les nouveaux champs  lutilisateur et faites-les-lui soumettre. Puis envoyez-les  ce module avec <var>$1continue</var> et lensemble des champs appropris, et recommencez ltape 4.\n#* Si vous avez reu <samp>REDIRECT</samp>, envoyez lutilisateur vers la cible <samp>redirecttarget</samp> et attendez le retour vers <var>$1returnurl</var>. Puis envoyez  ce module avec <var>$1continue</var> et tous les champs passs  lURL de retour, puis rptez ltape 4.\n#* Si vous avez reu <samp>RESTART</samp>, cela veut dire que lauthentification a fonctionn, mais nous navons pas de compte utilisateur li. Vous pouvez traiter cela comme un <samp>UI</samp> ou un <samp>FAIL</samp>.\";'),('fr','messages:api-help-authmanagerhelper-additional-params','s:375:\"Ce module accepte des paramtres supplmentaires selon les requtes dauthentification disponibles. Utiliser <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> (ou une rponse prcdente de ce module, le cas chant) pour dterminer les requtes disponibles et les champs quelles utilisent.\";'),('fr','messages:api-help-authmanagerhelper-continue','s:158:\"Cette requte est une continuation aprs une prcdente rponse <samp>UI</samp> ou <samp>REDIRECT</samp>. Cela ou <var>$1returnurl</var> est obligatoire.\";'),('fr','messages:api-help-authmanagerhelper-mergerequestfields','s:91:\"Fusionner dans un tableau le champ information de toutes les demandes dauthentification.\";'),('fr','messages:api-help-authmanagerhelper-messageformat','s:47:\"Format  utiliser pour retourner les messages.\";'),('fr','messages:api-help-authmanagerhelper-preservestate','s:92:\"Conserver ltat dune prcdente tentative de connexion qui a chou, si possible.\";'),('fr','messages:api-help-authmanagerhelper-request','s:205:\"Utiliser cette requte dauthentification, avec l<samp>id</samp> renvoy par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd>.\";'),('fr','messages:api-help-authmanagerhelper-requests','s:264:\"Utiliser uniquement ces requtes dauthentification, avec l<samp>id</samp> renvoy par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> ou depuis une rponse prcdente de ce module.\";'),('fr','messages:api-help-authmanagerhelper-returnurl','s:578:\"Renvoyer lURL pour les flux dauthentification tiers, qui doit tre absolue. Cela ou <var>$1continue</var> est obligatoire.\n\nDs rception dune rponse <samp>REDIRECT</samp>, vous ouvrirez typiquement un navigateur ou un affichage web vers lURL <samp>redirecttarget</samp> spcifie pour un flux dauthentification tiers. Une fois ceci termin, le tiers renverra le navigateur ou laffichage web vers cette URL. Vous devez extraire toute requte ou paramtre POST de lURL et les passer comme une requte <var>$1continue</var>  ce module de lAPI.\";'),('fr','messages:api-help-datatype-boolean','s:224:\"Les paramtres boolens fonctionnent comme des cases  cocher HTML: si le paramtre est spcifi, quelle que soit sa valeur, il est considr comme vrai. Pour une valeur fausse, omettre compltement le paramtre.\";'),('fr','messages:api-help-datatype-expiry','s:267:\"Valeurs dexpiration relatives (par ex. <kbd>5 months</kbd> ou <kbd>2 weeks</kbd>) ou absolues (par ex. <kbd>2014-09-18T12:34:56Z</kbd>). Pour ne pas avoir dexpiration, utiliser <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> ou <kbd>never</kbd>.\";'),('fr','messages:api-help-datatype-timestamp','s:458:\"Les horodatages peuvent tre spcifis sous plusieurs formes, voir [[mw:Special:MyLanguage/Timestamp|les formats dentre de la bibliothque Timestamp documents sur mediawiki.org]] pour plus de dtails. La date et lheure ISO 8601 sont recommands: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. De plus, la chane <kbd>now</kbd> peut tre utilise pour spcifier lhorodatage courant.\";'),('fr','messages:api-help-datatypes-header','s:16:\"Type de donnes\";'),('fr','messages:api-help-datatypes-top','s:753:\"Les entres dans MediaWiki doivent tre en UTF-8 normalis NFC. MediaWiki peut tenter de convertir les autres entres, mais cela peut faire chouer certaines oprations (comme des [[Special:ApiHelp/edit|modifications de pages]] avec les contrles MD5).\n\nLes paramtres qui prennent plusieurs valeurs sont normalement soumis avec les valeurs spares par des barres verticales, par ex. <kbd>param=valeur1|valeur2</kbd> ou <kbd>param=valeur1%7Cvaleur2</kbd>. Si une valeur doit contenir une barre verticale, utiliser U+001F (Sparateur Unix) comme sparateur \'\'et\'\' prfixer la valeur par U+001F, par ex. <kbd>param=%1Fvaleur1%1Fvaleur2</kbd>.\n\nCertains types de paramtre dans les requtes de lAPI ont besoin de plus dexplications:\";'),('fr','messages:api-help-examples','s:27:\"Exemple{{PLURAL:$1||s}}:\";'),('fr','messages:api-help-flag-deprecated','s:22:\"Ce module est dsuet.\";'),('fr','messages:api-help-flag-generator','s:49:\"Ce module peut tre utilis comme gnrateur.\";'),('fr','messages:api-help-flag-internal','s:105:\"<strong>Ce module est interne ou instable.</strong> Son fonctionnement peut tre modifi sans pravis.\";'),('fr','messages:api-help-flag-mustbeposted','s:45:\"Ce module naccepte que les requtes POST.\";'),('fr','messages:api-help-flag-readrights','s:43:\"Ce module ncessite des droits de lecture.\";'),('fr','messages:api-help-flag-writerights','s:46:\"Ce module ncessite des droits dcriture.\";'),('fr','messages:api-help-flags','s:0:\"\";'),('fr','messages:api-help-help-urls','s:0:\"\";'),('fr','messages:api-help-lead','s:172:\"Ceci est une page daide de lAPI de MediaWiki gnre automatiquement.\n\nDocumentation et exemples: https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page\";'),('fr','messages:api-help-license','s:21:\"Licence: [[$1|$2]]\";'),('fr','messages:api-help-license-noname','s:31:\"Licence: [[$1|Voir le lien]]\";'),('fr','mes