as o un module dAPI a besoin dune valeur pour chaque valeur dun autre paramtre quelconque. Par exemple, sil y avait un module dAPI pour demander un fruit, il pourrait avoir un paramtre <var>fruits</var> pour spcifier quels fruits sont demands et un paramtre de modle <var>{fruit}-quantit</var> pour spcifier la quantit demande de chaque fruit. Un client de lAPI qui voudrait une pomme, cinq bananes et vingt fraises pourrait alors faire une requte comme <kbd>fruits=pommes|bananes|fraises&pommes-quantit=1&bananes-quantit=5&fraises-quantit=20</kbd>.\";'),('fr','messages:api-help-templatedparams-header','s:22:\"Paramtres de modle\";'),('fr','messages:api-help-title','s:25:\"Aide de lAPI MediaWiki\";'),('fr','messages:api-help-undocumented-module','s:39:\"Aucune documentation pour le module $1.\";'),('fr','messages:api-login-fail-aborted','s:348:\"Lauthentification ncessite une interaction avec lutilisateur, qui nest pas prise en charge par <kbd>action=login</kbd>. Pour pouvoir se connecter avec <kbd>action=login</kbd>, voyez [[Special:BotPasswords]]. Pour continuer  utiliser la connexion du compte principal, voyez <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:api-login-fail-aborted-nobotpw','s:218:\"Lauthentification ncessite une interaction avec lutilisateur, qui nest pas prise en charge par <kbd>action=login</kbd>. Pour se connecter, voyez <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:api-login-fail-badsessionprovider','s:43:\"Impossible de se connecter en utilisant $1.\";'),('fr','messages:api-login-fail-sameorigin','s:86:\"Impossible de se connecter quand la politique de mme origine nest pas applique.\";'),('fr','messages:api-pageset-param-converttitles','s:235:\"Convertir les titres dans dautres variantes si ncessaire. Fonctionne uniquement si la langue de contenu du wiki prend en charge la conversion en variantes. Les langues qui prennent en charge la conversion en variantes incluent $1.\";')