L mis en forme amliore pour limpression).\";'),('fr','messages:apihelp-link','s:25:\"[[Special:ApiHelp/$1|$2]]\";'),('fr','messages:apihelp-linkaccount-example-link','s:74:\"Commencer le processus de liaison dun compte depuis <kbd>Exemple</kbd>.\";'),('fr','messages:apihelp-linkaccount-summary','s:66:\"Lier un compte dun fournisseur tiers  lutilisateur actuel.\";'),('fr','messages:apihelp-login-example-login','s:13:\"Se connecter.\";'),('fr','messages:apihelp-login-extended-description','s:311:\"Cette action ne devrait tre utilise quen lien avec [[Special:BotPasswords]]; lutiliser pour la connexion du compte principal est dsuet et peut chouer sans avertissement. Pour se connecter sans problme au compte principal, utiliser <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:apihelp-login-extended-description-nobotpasswords','s:165:\"Cette action est dsute et peut chouer sans prvenir. Pour se connecter sans problme, utiliser <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:apihelp-login-param-domain','s:21:\"Domaine (facultatif).\";'),('fr','messages:apihelp-login-param-name','s:20:\"Nom dutilisateur.\";'),('fr','messages:apihelp-login-param-password','s:13:\"Mot de passe.\";'),('fr','messages:apihelp-login-param-token','s:51:\"Jeton de connexion obtenu  la premire requte.\";'),('fr','messages:apihelp-login-summary','s:72:\"Se connecter et rcuprer les tmoins (cookies) dauthentification.\";'),('fr','messages:apihelp-logout-example-logout','s:36:\"Dconnecter lutilisateur actuel.\";'),('fr','messages:apihelp-logout-summary','s:51:\"Se dconnecter et effacer les donnes de session.\";'),('fr','messages:apihelp-main-extended-description','s:1549:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentation]]\n* [[mw:Special:MyLanguage/API:Etiquette|tiquette et guides dutilisation]]\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Liste de diffusion]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ Annonces de lAPI]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Suivi des anomalies et demandes damlioration]\n</div>\n<strong>tat:</strong> lAPI de MediaWiki est une interface stable et mature qui est supporte et amliore de faon active. Bien que nous essayions de lviter, nous avons parfois besoin de faire des modifications non rtrocompatibles; inscrivez-vous  [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ la liste de diffusion \'\'mediawiki-api-announce\'\'] pour tre inform des mises  jour.\n\n<strong>Requtes errones:</strong> si des requtes errones sont envoyes  lAPI, un entte HTTP sera renvoy avec la cl MediaWiki-API-Error. La valeur de cet entte et le code derreur renvoy prendront la mme valeur. Pour plus dinformations, voyez [[mw:Special:MyLanguage/API:Errors_and_warnings|API:Erreurs et avertissements]].\n\n<p class=\"mw-apisandbox-link\"><strong>Test:</strong> pour faciliter le test des requtes  lAPI, utilisez le [[Special:ApiSandbox|bac  sable de lAPI]].</p>\";'),('fr','messages:apihelp-main-param-action','s:24:\"Quelle action effectuer.\";'),('fr','messages:apihelp-main-param-assert','s:238:\"Vrifier que lutilisateur est connect lorsque la valeur est <kbd>user</kbd>, et quil nest <em>pas</em> connect si elle est <kbd>anon</kbd>, ou quil a le droit dun utilisateur robot lorsque la valeur est <kbd>bot</kbd>.\";'),('fr','messages:apihelp-main-param-assertuser','s:64:\"Vrifier que lutilisateur actuel est lutilisateur nomm.\";'),('fr','messages:apihelp-main-param-curtimestamp','s:48:\"Inclure lhorodatage actuel dans le rsultat.\";'),('fr','messages:apihelp-main-param-errorformat','s:507:\"Format  utiliser pour la sortie du texte davertissement et derreur.\n; plaintext: wikitexte sans aucun balisage HTML et avec les entits remplaces.\n; wikitext: wikitexte avec son balisage en syntaxe wiki non analyse.\n; html: wikitexte analys et mis en forme en HTML uniquement.\n; raw: cl de message et paramtres.\n; none: aucune sortie de texte, uniquement les codes erreur.\n; bc: ancien format utilis avant MediaWiki 1.29. <var>errorlang</var> et <var>errorsuselocal</var> sont ignors.\";'),('fr','messages:apihelp-main-param-errorlang','s:447:\"Langue  utiliser pour les avertissements et les erreurs. Spcifier un des codes langues utilisables renvoys par <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd>, sinon <kbd>content</kbd> pour utiliser la langue du contenu de ce wiki, ou encore <kbd>uselang</kbd> pour utiliser la mme valeur que le paramtre <var>uselang</var> (la langue prfre pour linterface utilisateur).\";'),('fr','messages:apihelp-main-param-errorsuselocal','s:129:\"Sil est fourni, les textes derreur utiliseront des messages adapts  la langue dans lespace de noms {{ns:MediaWiki}}.\";'),('fr','messages:apihelp-main-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-main-param-maxage','s:140:\"Fixer lentte HTTP de contrle de cache <code>max-age</code> au nombre indiqu de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-maxlag','s:622:\"La latence maximale peut tre utilise quand MediaWiki est install sur une grappe de rplication de base de donnes. Pour viter des actions provoquant un supplment de latence de rplication de site, ce paramtre peut faire attendre le client jusqu ce que la latence de rplication soit infrieure  une valeur spcifie. En cas de latence excessive, le code derreur <samp>maxlag</samp> est renvoy avec un message tel que <samp>Attente de $host: $lag secondes de dlai</samp>.<br />Voyez [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manuel: paramtre Maxlag]] pour plus dinformations.\";'),('fr','messages:apihelp-main-param-origin','s:1182:\"En accdant  lAPI en utilisant une requte AJAX inter-domaines (CORS), indiquez le domaine dorigine dans ce paramtre. Celui-ci doit tre inclus dans toute requte de \'\'pr-envol\'\' et doit donc faire partie de lURI de la requte (pas du corps du POST).\n\nPour les requtes authentifies, il doit correspondre exactement  une des origines dans lentte <code>Origin</code>, il doit donc tre fix avec quelque chose comme <kbd>https://en.wikipedia.org</kbd> ou <kbd>https://meta.wikimedia.org</kbd>. Si ce paramtre ne correspond pas  lentte <code>Origin</code>, une rponse 403 sera renvoye. Si ce paramtre correspond  lentte <code>Origin</code> et lorigine indique est autorise, lAPI renseignera en rponse les enttes <code>Access-Control-Allow-Origin</code> et <code>Access-Control-Allow-Credentials</code>.\n\nPour les requtes non authentifies, indiquez la valeur <kbd>*</kbd>. LAPI renseignera lentte <code>Access-Control-Allow-Origin</code> dans sa rponse, mais <code>Access-Control-Allow-Credentials</code> vaudra <code>false</code> et toutes les donnes spcifiques  lutilisateur seront filtres.\";'),('fr','messages:apihelp-main-param-requestid','s:105:\"Toute valeur fournie ici sera incluse dans la rponse. Peut tre utilis pour distinguer des demandes.\";'),('fr','messages:apihelp-main-param-responselanginfo','s:97:\"Inclure les langues utilises pour <var>uselang</var> et <var>errorlang</var> dans le rsultat.\";'),('fr','messages:apihelp-main-param-servedby','s:72:\"Inclure le nom dhte qui a renvoy la requte dans les rsultats.\";'),('fr','messages:apihelp-main-param-smaxage','s:135:\"Fixer lentte HTTP de contrle de cache <code>s-maxage</code>  ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-uselang','s:403:\"Langue  utiliser pour les traductions de message: utilisez la requte de lAPI <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd> pour renvoyer une liste de codes de langue, sinon indiquez <kbd>user</kbd> pour utiliser la langue prfre de lutilisateur actuel, ou bien <kbd>content</kbd> pour utiliser la langue du contenu de ce wiki.\";'),('fr','messages:apihelp-main-paramvalue-errorformat-bc','s:102:\"Format utilis avant MediaWiki 1.29. <var>errorlang</var> et <var>errorsuselocal</var> sont ignors.\";'),('fr','messages:apihelp-main-paramvalue-errorformat-html','s:4:\"HTML\";'),('fr','messages:apihelp-main-paramvalue-errorformat-none','s:48:\"Sortie sans texte, seulement les codes d\'erreur.\";'),('fr','messages:apihelp-main-paramvalue-errorformat-plaintext','s:66:\"Wikitexte avec des balises HTML supprim et entits remplaces.\";'),('fr','messages:apihelp-main-paramvalue-errorformat-raw','s:31:\"Cl et paramtres du message.\";'),('fr','messages:apihelp-main-paramvalue-errorformat-wikitext','s:23:\"Wikitexte non analys.\";'),('fr','messages:apihelp-main-summary','s:0:\"\";'),('fr','messages:apihelp-managetags-example-activate','s:94:\"Activer une balise nomme <kbd>spam</kbd> avec le motif <kbd>For use in edit patrolling</kbd>\";'),('fr','messages:apihelp-managetags-example-create','s:93:\"Crer une balise nomme <kbd>spam</kbd> avec le motif <kbd>For use in edit patrolling</kbd>\";'),('fr','messages:apihelp-managetags-example-deactivate','s:90:\"Dsactiver une balise nomme <kbd>spam</kbd> avec le motif <kbd>No longer required</kbd>\";'),('fr','messages:apihelp-managetags-example-delete','s:74:\"Supprimer la balise <kbd>vandlaism</kbd> avec le motif <kbd>Misspelt</kbd>\";'),('fr','messages:apihelp-managetags-param-ignorewarnings','s:83:\"Sil faut ignorer tout avertissement qui surviendrait au cours de lopration.\";'),('fr','messages:apihelp-managetags-param-operation','s:547:\"Quelle opration effectuer :\n;create:Crer une nouvelle balise de modification pour un usage manuel.\n;delete:Supprimer une balise de modification de la base de donnes, y compris la suppression de la marque de toutes les rvisions, entres de modification rcente et entres de journal dans lesquelles elle serait utilise.\n;activate:Activer une balise de modification, permettant aux utilisateurs de lappliquer manuellement.\n;deactivate:Dsactiver une balise de modification, empchant les utilisateurs de lappliquer manuellement.\";'),('fr','messages:apihelp-managetags-param-reason','s:77:\"Un motif facultatif pour crer, supprimer, activer ou dsactiver la balise.\";'),('fr','messages:apihelp-managetags-param-tag','s:347:\"Balise  crer, supprimer, activer ou dsactiver. Pour la cration de balise, elle ne doit pas exister. Pour la suppression de balise, elle doit exister. Pour lactivation de balise, elle doit exister et ne pas tre utilise par une extension. Pour la dsactivation de balise, elle doit tre actuellement active et dfinie manuellement.\";'),('fr','messages:apihelp-managetags-param-tags','s:83:\"Modifier les balises  appliquer  lentre du journal de gestion des balises.\";'),('fr','messages:apihelp-managetags-summary','s:71:\"Effectuer des tches de gestion relatives aux balises de modification.\";'),('fr','messages:apihelp-mergehistory-example-merge','s:90:\"Fusionner lhistorique complet de  <kbd>AnciennePage</kbd> dans <kbd>NouvellePage</kbd>.\";'),('fr','messages:apihelp-mergehistory-example-merge-timestamp','s:132:\"Fusionner les rvisions de la page <kbd>AnciennePage</kbd> jusquau <kbd>2015-12-31T04:37:41Z</kbd> dans <kbd>NouvellePage</kbd>.\";'),('fr','messages:apihelp-mergehistory-param-from','s:112:\"Titre de la page depuis laquelle lhistorique sera fusionn. Impossible  utiliser avec <var>$1fromid</var>.\";'),('fr','messages:apihelp-mergehistory-param-fromid','s:107:\"ID de la page depuis laquelle lhistorique sera fusionn. Impossible  utiliser avec <var>$1from</var>.\";'),('fr','messages:apihelp-mergehistory-param-reason','s:37:\"Raison pour fusionner lhistorique.\";'),('fr','messages:apihelp-mergehistory-param-timestamp','s:250:\"Horodatage jusquauquel les rvisions seront dplaces de lhistorique de la page source vers lhistorique de la page de destination. Sil est omis, tout lhisto