ue la page ne sera <strong>pas</strong> renomme sil existe dj une page portant le nouveau titre, sauf si cette dernire est une simple redirection avec un historique de modifications vierge.\nCela signifie que vous pouvez de nouveau renommer une page vers sa position dorigine si vous avez fait une erreur mais que vous ne pouvez pas craser une page existante.\n\n<strong>Attention!</strong>\nCeci peut provoquer un changement radical et imprvu pour une page souvent consulte; assurez-vous davoir compris les consquences de votre dmarche avant de continuer.\";'),('fr','messages:movepagetext-noredirectfixer','s:1022:\"Utilisez le formulaire ci-dessous pour renommer une page, tout en dplaant tout son historique vers le nouveau nom.\nLancien titre deviendra une page de redirection vers le nouveau titre.\nVrifiez bien les [[Special:DoubleRedirects|doubles redirections]] ou les [[Special:BrokenRedirects|redirections casses]].\nVous avez la responsabilit de vous assurer que les liens continuent de pointer vers leur destination suppose.\n\nNotez que la page ne sera <strong>pas</strong> dplace sil existe dj une page avec le nouveau titre, sauf si cette dernire a un historique de modifications vierge et est soit vide, soit une simple redirection.\nCela signifie que vous pouvez renommer une page vers sa position dorigine si le dplacement savre erron mais que vous ne pouvez pas craser une page existante.\n\n<strong>Attention!</strong>\nCeci peut provoquer un changement radical et imprvu pour une page souvent consulte; assurez-vous den avoir compris les consquences avant de continuer.\";'),('fr','messages:movepagetext-noredirectsupport','s:712:\"Utilisez le formulaire ci-dessous pour renommer une page, tout en dplaant tout son historique vers le nouveau nom.\nVous avez la responsabilit de vous assurer que les liens continuent de pointer vers leur destination suppose.\n\nNotez que la page ne sera <strong>pas</strong> dplace sil existe dj une page avec le nouveau titre.\nCela signifie q